angular.module("templates").run(["$templateCache", function($templateCache) {$templateCache.put("/auth/templates/locks.html","<h4>Locks</h4> \n<div class=\"col-12\">\n	<div class=\"form-group\">\n		<button class=\"btn btn-light\" \n			ng-repeat=\"x in locks.pin track by $index\">\n			<i class=\"fas\" ng-class=\"{\'fa-circle\' : x == \'X\', \'fa-dot-circle\' : x != \'X\'}\"></i>\n		</button>\n	</div>\n</div>\n<div class=\"col-12\">\n	<div class=\"form-group\">\n		<span ng-repeat=\"x in [1,2,3]\">\n			<button class=\"btn btn-light btn-fix\"  ng-click=\"locks.type(x)\">{{x}}</button>\n		</span>\n	</div>\n</div>\n<div class=\"col-12\">\n	<div class=\"form-group\">\n		<span ng-repeat=\"x in [4,5,6]\">\n			<button class=\"btn btn-light btn-fix\"  ng-click=\"locks.type(x)\">{{x}}</button>\n		</span>\n	</div>\n</div>\n<div class=\"col-12\">\n	<div class=\"form-group\">\n		<span ng-repeat=\"x in [7,8,9]\">\n			<button class=\"btn btn-light btn-fix\"  ng-click=\"locks.type(x)\">{{x}}</button>\n		</span>\n	</div>\n</div>\n<div class=\"col-md-4 col-sd-12 form-group\">\n	<div class=\"form-group\">\n		<span>\n			<button class=\"btn btn-light btn-fix\" disabled>#</button>\n		</span>\n		<span>\n			<button class=\"btn btn-light btn-fix\" ng-click=\"locks.type(0)\">0</button>\n		</span>\n		<span>\n			<button class=\"btn btn-danger btn-fix\"\n				ng-click=\"locks.reset()\">\n				<i class=\"fas fa-redo\"></i>\n			</button>\n		</span>\n	</div>\n</div>\n<div ng-repeat=\"lock in locks.locks\" class=\"col-12\">\n	<div class=\"row\">\n		<div class=\"col-12\">\n			<div class=\"form-group\">\n				<button class=\"btn\" \n					ng-disabled=\"lock.status == 0\"\n					ng-class=\"{ \'btn-light\' : lock.status == 0, \'btn-primary\' : lock.status == 1, \'btn-secondary\' : lock.status == 0, \'btn-success\' : lock.status == 2, \'btn-danger\' : lock.status == -2}\"\n					ng-click=\"locks.tryUnlock(lock)\">\n					<i class=\"fas fa-unlock\"></i>\n					<b>{{lock.name}}</b> {{lock.lastKnownState.stateName}}\n				</button>\n			</div>\n		</div>\n	</div>\n</div>");}]);